import React from 'react'
import {Link} from 'react-router-dom';

export default function Navbar() {
    return (
        <div className="nav-bar">
           <Link style={{textDecoration:'none',color:'whitesmoke',alignSelf:'flex-start',marginLeft:'10px'}} to='/' >
               <h3>Dashboard</h3>
           </Link>
           <Link style={{textDecoration:'none',color:'whitesmoke',alignSelf:'flex-end'}} to="/cart">
               <h3>Portfolio</h3>
           </Link>
        </div>
    );
};
